import { Query } from "react-apollo";
import gql from "graphql-tag";

const CAT_QUERY = gql`
  query {
    categories {
      categoryId
      description
    }
  }
`;

export default function Categories() {
  <Query query={CAT_QUERY}>
    {({ loading, error, data }) => {
      data.categories.map(cat => {
        console.log(cat.categoryId + cat.description);
      });
    }}
    )}
  </Query>;
  return <div></div>;
}
